import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
const App = () => {
  return (
    <div>
      <Router>
        <Switch>
          <Route path="./Home">Home </Route>
          <Route path="./About">About</Route>
        </Switch>
      </Router>
    </div>
  );
};

export default App;
